import React from 'react';
import './App.css';

class App extends React.Component{



render() {

  return (
    <div id='User' onClick={this.props.click} className='User' data-item={this.props.user_id}>
     <div id='header'>
      <label id='name'>{this.props.name === '' ? 'No Name' : this.props.name}</label>
      <label id='prof'>{this.props.job}</label>
     </div>
     <div id='email'>
      <label>{this.props.email}</label>
     </div>
     <div id='body'>
     <label>Bio...</label>
     <div id='bio_div'>
     <p id='page'>{this.props.bio}</p>
     </div>
     <button>PATCH</button>
     </div>
    </div>
  );

}

}

export default App;
